function MessageList( {messageArr} ){

    return (
        <>
            {messageArr.map((selMessage)=>{
                <li key={selMessage.id}>
                   {selMessage.author} - {selMessage.text}
                </li>
            })}
        </>
    )
}

export default MessageList;
